import React from "react";

const Skills = ({ data }) => {
  if (data) {
    var technologies = data.technologies.map((technologies) => {
      var projectImage = "images/portfolio/" + technologies.image;
      return (
        <div key={technologies.name} className="columns skills-item">

        </div>
      );
    });
  }

  return (
    <section id="skills">
      {technologies}
    </section>
  );
};

export default Skills;
